import React,{useEffect, useState} from 'react'

export const TablaApp = () => {

  const [prodcutos, setProductos] = useState([])

    const fetchData = () => {
      fetch("http://scratchya.com.ar/react/datos.php")
        .then(response => {
          return response.json()
        })
        .then(data => {
          setProductos(data)
        })
    }  

    useEffect(() => {
      fetchData()
    }, [])

    
}
